			<footer className="pa2 black-80">
	 			 <p className="bold">2020 PetWorld</p>
	 			 <p className="bold">Contact information:</p>
	 			 <p className="bold">1634 Petworld street</p>
	 			 <p className="bold">Emporia, Kansas</p>
	 			 <p className="bold">+1(620)226-2226</p>
			</footer>
		</article>
	);
}

export default Footer;
